import React from 'react';
import { Button } from 'reactstrap';

const LandingButton = (props) => {
    return (
        <div style={{ margin: 'auto' }}>
            <Button
                onClick={props.handleClick()}
            >Get Weather</Button>
        </div>
    );
}

export default LandingButton;
